void mainImage( out vec4 fragColor, in vec2 fragCoord )
{

   fragCoord = fract(fragCoord * .01 * mat2(1, -.58, 0, 1.15));
   fragColor = vec4(fragCoord.y > 1. - fragCoord.x);

    vec4 col1 = vec4(.08,0.76,0.91,1.);
    vec4 col2 = vec4(1.,1.,0.1,1.);

    fragColor = mix(col1,col2,fragColor);

}
